Weekend! Pierwszy od hoho kiedy mogę powiedzieć, że na niego czekałam.
Zmiana pracy zdecydowanie na plus zmieniła moją kondycję psychiczną. Mam dużo motywacji, chęci do działania i życia. Wręcz pokuszę się, że dzięki ostatnim dniom zaczynam odżywac, a nie spodziewałam się tego po takiej przerwie, w dodatku mialam strasznego stres, ale na szczęście poki co nie mam na co narzekać 💞

Na budowę dzisiaj w koncu zawitali najbardziej wyczekiwani przeze mnie goście - moja rodzina ❣️. Nie mogłam się doczekać tego momentu.
Mieliśmy też kolejne spotkanie ze stolarzem w sprawie kuchni, pobral już wymiary i będziemy powoli działać 💪🏻 nadal ciekawa tylko jestem ile zajmie wymiana okien, bo jak czytalam niektóre wasze historie to ręce opadają 🙄 także temat okien narazie zamykam.
W naszym domku ogolnie ludzie robią sobie party hard, ogniska, winka, dzieciaki na szyby poprzyklaly naklejki... Nawet znalazła się zużyta (!) podpaska. Czekam na drzwi do domu, bo z każdym przyjazdem tam się załamuje. Z najnowszych wieści od dewelopera - termin z hydraulikiem znowu uległ przesunięciu. Już widzę jak wykańczamy dom w grudniu... 😂
Besos!

